window.bookSummaryJSON = "<p>Monsters don't often look like monsters on the outside.</p> <p>Forced to marry a man I should hate, I'm now bound to Damian.</p> <p>I sometimes wonder what he sees when he looks at me. Deer in headlights, I guess.</p> <p>What I see is clear.</p> <p>Darkness. Desire. Carnal want.</p> <p>A man with too much experience.</p> <p>The day he took me he told me I belong to him. On our wedding night he proved I did. And I believe him when he says he'll keep me safe because he won't let anyone touch what's his.</p> <p>But I can't forget what he is. Can't forget the things he's done.</p> <p>And no matter what, I can't let myself fall in love with him.</p>"; 
